INSERT INTO `ysk_product_detail` VALUES('73','25','鼎鑫胸部养护套装','','400','','0','/Uploads/image/product/5ad07e4c9d96c.png','/Uploads/image/product/5ad07e54cdc84.png','/Uploads/image/product/5ad07e6112c97.png','/Uploads/image/product/5ad07e6b2c137.png','/Uploads/image/product/2018-02-23/5a8f94e6f3776.jpeg','','','','1519359207','15','1','','','200','0','&lt;p&gt;&lt;img alt=&quot;产品介绍&quot; src=&quot;http://www.weixinfxsc.com/upload/test/20170602/1496382236863006.jpg&quot; style=&quot;-webkit-tap-highlight-color:rgba(255, 255, 255, 0); border:none; height:470px; list-style:none; margin:0px; outline:none; padding:0px; width:594.25px; word-break:break-all !important; word-wrap:break-word !important&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;鼎鑫胸部养护套装&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　疏通乳腺管，软坚散结，提升胸部结缔组织的弹性，收紧下垂肌肤，消除乳腺疾病，平衡内分泌，是胸部丰满均匀，坚实，紧挺，柔韧，保持健美形体，拥有完美曲线。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第一步：沙棘肽胸部活焕霜：取本品适量，根据使用方法说明书在保养部位进行按摩操作。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第二步：沙棘肽胸部精粹油：取本品1支，涂抹在保养部位进行按摩推拿，直至吸收。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第三步：沙棘肽胸部焕养液：取本品1支，涂抹至保养部位，用手指轻拍，直至完全吸收。&lt;/p&gt;\r\n','','0','','','1','','','14','0','458.00','','2','1','2','0','1');
INSERT INTO `ysk_product_detail` VALUES('145','25','鼎鑫鑫润营养片','','456','','0','/Uploads/image/product/2018-04-14/5ad18c9419db2.png','/Uploads/image/product/2018-04-14/5ad18c941b2d5.png','/Uploads/image/product/2018-04-14/5ad18c941c6c1.png','','','','','','1523682452','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad9889e0b74e.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫鑫润营养片&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘，山楂，决明子，白果，葛根，茯苓，佛手，甘草&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【相关知识】：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　山楂主要成分是黄酮类物质，对心血管系统有明显的药理作用。目前，从山楂中分离的黄酮成分有30余种，主要有台罕见的黄酮苷类、黄酮醇及其苷类、双氧黄酮苷类、聚合黄酮类。另一类重要的成分是三萜类物质，强心、增加冠脉血流、预防心血管疾病，具有扩张血管、强心、增加冠脉血流量、改善心脏活力、兴奋中枢神经系统、降低血压和胆固醇、软化血管及利尿和镇静作用；防治动脉硬化，防衰老的作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　虫草酸&amp;mdash;&amp;mdash;能缓慢而持久地增加冠状动脉流量、对动脉血管有明显抑制胶原性血小板聚集的作用。改善血液循环、提高血液供氧能力、防止血栓、对冠心病有稳定的治疗和康复作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　灵芝多肽&amp;mdash;&amp;mdash;可抑制胆固醇台成过程中的酶，由此抑制胆固醇的生物合成。能程度不等的降低血清胆固醇、甘油三脂和B-脂蛋白。同时，还具有降低全血粘度和血浆粘度的作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;　　【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','1','1','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('146','25','鼎鑫沙棘果片','','298','','0','/Uploads/image/product/2018-04-14/5ad18d1432975.png','/Uploads/image/product/2018-04-14/5ad18d14341e5.png','/Uploads/image/product/2018-04-14/5ad18d14366ec.png','/Uploads/image/product/2018-04-14/5ad18d14389ab.png','/Uploads/image/product/2018-04-14/5ad18d143aa1f.png','','','','1523682580','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad987e4eec6c.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad987f2914aa.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad987ff9aeec.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad9880c4add8.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘果片&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【相关知识】：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘中富含维生素C，维生素E，类胡萝卜素、多种氨基酸、有机酸、有酸、亚油酸、黄酮类化合物、磷脂类化合物、酚类化合物、甾醇类化合物、微量元素、蛋白质等人体必需的营养保健成份。沙棘籽中不饱和脂肪酸高达80%，十八种氨基酸中人体必需的八种全优，而且含量都很高，含有十二种人体必需的微量元素，其中钙、铁、锌、钾、硒的含量都较高。除此外，还含有苦木素、香豆素、白花青素、白果素、儿茶素、甜菜碱、5&amp;mdash;羟色氨等剧抗肿瘤、抗溃疡、抗炎、抗动脉硬化，抗辐射、抗衰老等方面作用的生物活性成份。沙棘神奇的抗炎、抗衰老等作用是由于沙集中多种生物活性物质的合理组配同人体的需要相适应。190多种生物活性成份居于沙棘之中，这在自然界是个奇迹。这与沙棘生长的自然环境所造就的顽强生命力及沙棘植物古老的生长历史分不开。沙棘真正是&amp;mdash;&amp;mdash;神奇的生命之果。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;　　【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','1','1','0','1','1');
