INSERT INTO `ysk_product_detail` VALUES('149','25','鼎鑫沙棘紫参片','','399','','0','/Uploads/image/product/2018-04-14/5ad18e09cef4a.png','/Uploads/image/product/2018-04-14/5ad18e09d0e5a.png','','','','','','','1523682825','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad9868fb7eac.png&quot; style=&quot;height:482px; width:585px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘紫参片&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘、紫苏籽、枸杞、人参、大枣、决明子&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【注意事项】：本品不可代替药物&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','1','1','1','1');
INSERT INTO `ysk_product_detail` VALUES('150','25','鼎鑫沙棘虫草片','','399','','0','/Uploads/image/product/2018-04-14/5ad18e56ae01b.png','/Uploads/image/product/2018-04-14/5ad18e56afdbb.png','','','','','','','1523682902','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad9864247661.png&quot; style=&quot;height:395px; width:452px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘虫草片&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘、冬虫夏草&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【相关知识】：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　冬虫夏草有&amp;ldquo;百药之王&amp;rdquo;的美称。被历代医家称为&amp;ldquo;治诸虚百损至为上品&amp;rdquo;。它性平味甘，温平无毒，具有补肺肾、治咳嗽、益虚损、养精气之功能。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　冬虫夏草的功能：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　1.抗菌；2.免疫调节；3.抗炎；4.滋肾；5.提高肾上腺皮质醇含量；6.抗心律失常；7.抗疲劳；8.祛痰平喘；9.镇静催眠。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【注意事项】：本品不可代替药物&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','1','1','1','1','1');
INSERT INTO `ysk_product_detail` VALUES('98','25','鼎鑫沙棘凝胶','','298','','0','/Uploads/image/product/5ad07ee1a4807.png','/Uploads/image/product/5ad07eed25d81.png','/Uploads/image/product/5ad07ef53bfe5.png','','','','','','1519352900','16','1','','','300','0','&lt;p&gt;&lt;img alt=&quot;产品介绍&quot; src=&quot;http://www.weixinfxsc.com/upload/test/20170602/1496381826280867.jpg&quot; style=&quot;-webkit-tap-highlight-color:rgba(255, 255, 255, 0); border:none; height:564px; list-style:none; margin:0px; outline:none; padding:0px; width:594.25px; word-break:break-all !important; word-wrap:break-word !important&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　鼎鑫沙棘凝胶&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　采用了优质原料&amp;mdash;&amp;mdash;由先进的&amp;ldquo;冷冻稳定法&amp;rdquo;从天然野生沙棘果中提炼而成，其纯净度高，能舒缓皮肤不适，保持皮肤健康，防止皮肤粗糙，增强皮肤弹性，对皮肤没有刺激性。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘凝胶中的有效成分能扩张毛细血管，促进微循环，强化细胞活力。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘凝胶内含的OPC，维生素C，维生素E，胡萝卜素等自由基的清除剂，能有效延缓皮肤细胞变老。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘凝胶内的氨基酸、维生素、矿物质、酵素、有机酸及水是皮肤必须的营养素，具有天生的收敛作用，能使皮肤坚实细致，预防皮肤松弛，有效锁住水分，抑制产生黑色素。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　缓解皮肤干性，使皱纹明显减少，皮肤变白皙。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　由杀菌功能，若有外阴瘙痒的症状，也可以用沙棘凝胶外涂。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　祛斑淡斑，在有斑的部位多做按摩，促进皮肤吸收，增强微循环，1日3次。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　保湿美白：刺激血液循环，帮助肌肤捕捉氧气，激活细胞活性，锁住水分，抑制斑点产生，美白皮肤。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　控油祛痘：平衡肌肤成分，达到水油平衡，含有的杀菌成分能抑制微生物生长，减少痘痘的再生。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　晒后修护：镇静肌肤，消除晒后不适，其修护成分能帮助皮肤提高抵御外界侵害。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　对各种皮肤病具有很好的改善及康复作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　适用人群广泛，大人小孩都可使用。&lt;/p&gt;\r\n','','0','','','1','','','14','0','472.00','','2','1','2','1','1');
INSERT INTO `ysk_product_detail` VALUES('99','25','鼎鑫沙棘油（果油）软胶囊','','399','','0','/Uploads/image/product/5ad07c98a5d37.png','/Uploads/image/product/5ad07ca171a81.png','','','','','','','1519726589','11','1','','','666','0','&lt;div&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div&gt;\r\n&lt;div&gt;\r\n&lt;p&gt;&lt;img alt=&quot;产品介绍&quot; src=&quot;http://www.weixinfxsc.com/upload/test/20170602/1496374116727380.jpg&quot; style=&quot;-webkit-tap-highlight-color:rgba(255, 255, 255, 0); border:none; height:445px; list-style:none; margin:0px; outline:none; padding:0px; width:594.25px; word-break:break-all !important; word-wrap:break-word !important&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　鼎鑫沙棘油（果油）软胶囊&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘&lt;/p&gt;\r\n\r\n&lt;p&gt;　&lt;strong&gt;　【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n','','0','','','1','','','14','0','304.00','','2','1','2','1','1');
INSERT INTO `ysk_product_detail` VALUES('97','25','鼎鑫沙棘逆颜水凝蚕丝面膜','','399','','0','/Uploads/image/product/5ad07f4bd8065.png','/Uploads/image/product/5ad07f52c1239.png','/Uploads/image/product/5ad07f6294cbb.png','','','','','','1519269011','17','1','','','400','0','&lt;div&gt;\r\n&lt;div&gt;\r\n&lt;p&gt;&lt;img alt=&quot;产品介绍&quot; src=&quot;http://www.weixinfxsc.com/upload/test/20170602/1496382489862250.jpg&quot; style=&quot;-webkit-tap-highlight-color:rgba(255, 255, 255, 0); border:none; height:486px; list-style:none; margin:0px; outline:none; padding:0px; width:594.25px; word-break:break-all !important; word-wrap:break-word !important&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;鼎鑫沙棘逆颜水凝蚕丝面膜&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　本品使用100%真蚕丝做贴膜，并且同时蕴含当今全球最具影响力的四大肌肤改善成分：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　1、沙棘萃取精华&amp;ldquo;OPCs（逆生长基础因子）：肌肤逆生长的基质&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　2、&amp;ldquo;NMF&amp;amp;HA（天然保湿因子）：肌肤逆生长的天然水源&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　3、&amp;ldquo;SACA（强力抗氧化细胞活化促进因子）： 肌肤逆生长的工程师&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　4、&amp;ldquo;EGF（美丽因子）：肌肤逆生长的&amp;ldquo;真命&amp;rdquo;美容天使&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要功效】：清透亮颜，滋养肌肤，改善肌肤光泽，娇细柔嫩，保持肌肤活力，使肌肤光滑细腻。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【使用方法】：洁肤后，先将法国海洋之谜羽丝缕面膜兰色无纺布揭掉，将中间层的面膜直接敷在面部并轻按压，再将有孔珍珠膜揭掉，20分钟左右取下即可，并把残留精华液轻按摩至吸收；每天使用效果更佳。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【注意事项】：每个人的肤质各不相同，建议使用前先进行局部的皮肤测试。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n','','0','','','1','','','14','0','544.00','','2','1','2','1','1');
INSERT INTO `ysk_product_detail` VALUES('96','25','鼎鑫沙棘果油（精油）','','399','','0','/Uploads/image/product/5a8bad158056f.jpg','/Uploads/image/product/5ad0775e3aff1.png','','','','','','','1519103413','0','0','','','999','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad98bd10382c.png&quot; style=&quot;height:360px; width:230px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘果油（精油）&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【使用方法】：早晚空腹1到2毫升，含服。 也可外用，涂抹于作用部位，轻轻按摩至吸收。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【注意事项】：本品不可代替药物&lt;/p&gt;\r\n','','0','','','1','','','0','0','0.00','','2','2','2','1','0');
INSERT INTO `ysk_product_detail` VALUES('115','25','鼎鑫天然沙棘手工精油皂','','298','','0','/Uploads/image/product/5a979a182e658.jpg','/Uploads/image/product/5ad077ed62da7.png','','','','','','','1519884843','3','1','','','100','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad98f66c0aa9.png&quot; style=&quot;height:278px; width:286px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫天然沙棘手工精油皂&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　本品由沙棘油、沙棘OPC、椰子油、甜杏仁油、甘油等多种食用级的特种营养植物油原料，及天然沙棘精油、玫瑰精油、柠檬精油等制成的含有天然植物芳香烃的天然植物精油皂。天然沙棘手工精油皂不添加任何防腐剂，表面活性剂等化学成分，是一种非常安全而有效的皮肤清洁及美容产品，低温制作，甘油不会流失，除了细腻的清洁效果，还能呵护滋润皮肤，不会对皮肤造成负担，还能具有精油的养护效果，比市面上常用的洗面奶效果好，而且安全。天然沙棘手工精油皂能提供非常高的保湿效能，同时也能够更深层清洁肌肤，给予肌肤最健康自然的呵护。并富有轻柔、清新的植物香氛，使人如沐大自然的海洋。天然沙棘手工精油皂适用所有肤质，尤其是干燥或任何敏感红肿和发炎皮肤。主要成分沙棘OPC具有强壮和收缩微血管的效果， 对老化皮肤有极佳的回春作用。抚平情绪，沮丧、哀伤、妒忌和憎恶的时候，提振心情，舒缓神经紧张和压力，能使女人对自我产生积极、正面的感受。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　天然沙棘手工精油皂含丰富的维生素C，特别有益于美白、收敛、平衡油脂、治疗青春痘等油性皮肤症状。其味道清新甜美，对于季节转化，肌肤极容易出现的问题，洗洗都能轻松解决，让您恢复亮白娇嫩肌肤，充满自信。&lt;/p&gt;\r\n','','0','','','1','','','0','0','0.00','','0','0','0','1','0');
INSERT INTO `ysk_product_detail` VALUES('117','25','鼎鑫洛神营养片','','499','','0','/Uploads/image/product/5ad07c2b90ee5.png','/Uploads/image/product/5ad07c3214998.png','/Uploads/image/product/5ad07c37b6d22.png','','','','','','1519980205','10','1','','','100','0','&lt;p&gt;&lt;img alt=&quot;产品介绍&quot; src=&quot;http://www.weixinfxsc.com/upload/test/20170602/1496375303963782.jpg&quot; style=&quot;-webkit-tap-highlight-color:rgba(255, 255, 255, 0); border:none; height:445px; list-style:none; margin:0px; outline:none; padding:0px; width:594.25px; word-break:break-all !important; word-wrap:break-word !important&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;鼎鑫洛神营养片&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：白芷、菊花、甘草、枸杞、桃仁、决明子、向日葵花粉、茯苓、黄精、牡蛎&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【相关知识】：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　白芷&amp;mdash;&amp;mdash;祛风解表、散寒止痛、除湿通窍、消肿排脓。可改善人体微循环，促进皮肤新陈代谢，消除色素在组织中过度堆积。《神农本草经》指出白芷：&amp;ldquo;长肌肤。润泽颜色，可作面脂。&amp;rdquo;无论是&amp;ldquo;干金面脂方&amp;rdquo;，或是慈禧太后的驻颜宫廷秘方&amp;ldquo;玉容散&amp;rdquo;，白芷都是制作面脂的主要原料。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　菊花&amp;mdash;一菊花能增强谷胱甘脑过氧化降低，具有清除自由基的能力，专家研究则发现，菊花提取物对生物膜的超氧阴离子自由基损伤具有明显保护作用，主要是通过直接进入细胞障的甘油酯后而起保护作用。这一新的发现使菊花有望开发成为新的功能性食品，尤其在抗衰老食品中发挥其作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　女人衰老的机理无外乎阴阳失衡，气血失和，气机升降出入失常，脏腑功能失调。肥胖、便秘、色斑、口臭、体臭、高血脂等疾病时有发生，如果加上心理负担，则机体衰老就会加速。女人要学会关爱自己，遁畅身体，从而通畅心理，定期的排出体内毒素，调整机体状态无疑会为今天的美丽和明日的健康打下坚实的基础。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;　　【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;div&gt;&amp;nbsp;&lt;/div&gt;\r\n','','0','','','1','','','14','0','0.00','','1','1','1','1','1');
INSERT INTO `ysk_product_detail` VALUES('141','25','鼎鑫沙棘【OPC】片','','399','','0','/Uploads/image/product/2018-04-14/5ad18b22c4250.png','/Uploads/image/product/2018-04-14/5ad18b22c59d0.png','/Uploads/image/product/2018-04-14/5ad18b22c7254.png','','','','','','1523682082','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad98a08dde72.png&quot; style=&quot;height:255px; width:250px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad989ddeb147.png&quot; style=&quot;height:435px; width:197px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘【OPC】片&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘原花青素（OPC）&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【相关知识】：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘原花青素能促进细胞新陈代谢，抑制组胺产生，减轻炎症，愈合胃肠溃疡，具有较强的消炎促进新生的功能；深入脾胃，滋补肾脏，促进肠胃消化食物，吸收养分，滋阴补阳。通过肾及内分泌系统的调控作用，改善新陈代谢，生发五脏元气，推动全身血脉正常运行。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　其次，沙棘原花青素清除自由基、消除血液垃圾，清除五脏和血液中残留的甘油三酯、胆固醇、自由基、血毒、药毒等多种人体垃圾，祛除淤血，改善身体的血瘀状态。同时，原花青素还改善毛细血管状态，增强动脉、静脉、毛细血管的弹性，增强流向心脑的血液循环，元气旺盛，血液动力足，身体血瘀不再有。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;　　【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','1','0','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('119','25','鼎鑫沙棘虫草片','','399','','0','/Uploads/image/product/5a9937f666cb0.jpg','/Uploads/image/product/5ad0850bc7077.png','','','','','','','1519990780','32','1','','','192','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad98b85f320e.png&quot; style=&quot;height:394px; width:440px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘虫草片&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘、冬虫夏草&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【相关知识】：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　冬虫夏草有&amp;ldquo;百药之王&amp;rdquo;的美称。被历代医家称为&amp;ldquo;治诸虚百损至为上品&amp;rdquo;。它性平味甘，温平无毒，具有补肺肾、治咳嗽、益虚损、养精气之功能。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　冬虫夏草的功能：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　1.抗菌；2.免疫调节；3.抗炎；4.滋肾；5.提高肾上腺皮质醇含量；6.抗心律失常；7.抗疲劳；8.祛痰平喘；9.镇静催眠。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【注意事项】：本品不可代替药&lt;/p&gt;\r\n','','0','','','1','','','0','0','0.00','','0','0','0','0','1');
