INSERT INTO `ysk_product_detail` VALUES('133','25','鼎鑫沙棘【OPC】片','','399','','0','/Uploads/image/product/5ad08434b0dd3.png','/Uploads/image/product/5ad481dd69020.png','','','','','','','1523601040','2','1','','','4529','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad98b15a86b7.png&quot; style=&quot;height:255px; width:250px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad98b44ab216.png&quot; style=&quot;height:435px; width:197px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘【OPC】片&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘原花青素（OPC）&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【相关知识】：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘原花青素能促进细胞新陈代谢，抑制组胺产生，减轻炎症，愈合胃肠溃疡，具有较强的消炎促进新生的功能；深入脾胃，滋补肾脏，促进肠胃消化食物，吸收养分，滋阴补阳。通过肾及内分泌系统的调控作用，改善新陈代谢，生发五脏元气，推动全身血脉正常运行。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　其次，沙棘原花青素清除自由基、消除血液垃圾，清除五脏和血液中残留的甘油三酯、胆固醇、自由基、血毒、药毒等多种人体垃圾，祛除淤血，改善身体的血瘀状态。同时，原花青素还改善毛细血管状态，增强动脉、静脉、毛细血管的弹性，增强流向心脑的血液循环，元气旺盛，血液动力足，身体血瘀不再有。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;　　【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n','','0','','','1','','','0','','0.00','','0','0','0','1','1');
