INSERT INTO `ysk_product_detail` VALUES('135','25','鼎鑫沙棘籽油螺旋藻维生素E软胶囊','','450','','0','/Uploads/image/product/5ad4004de44d4.png','/Uploads/image/product/5ad4393a33d48.png','','','','','','','1523605971','56','1','','','49','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad98aad0152b.png&quot; style=&quot;height:178px; width:257px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫宜能胶囊&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：杜仲、绞股蓝、沙棘、人参&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【相关知识】：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　绞股蓝民间有句俚语&amp;ldquo;北有长白参，南有绞股蓝&amp;rdquo;自明太祖朱元璋第五子朱橚的《救荒本草》至今被称长生不老草-绞股蓝之美誉。具有降血压、降血脂、降血糖、护心保肝，调脂减肥、增强机体免疫力的的功效。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘早在200多年前，成吉思汗便发现了沙棘的药用价值，御医用沙棘为蒙古贵族调制出了强身治病的蒙药。成吉思汗长年征战在外，平日就靠沙棘强身健体、抵御疾病。成吉思汗年过六旬仍能弯弓射雕，便与长期服用沙棘有关。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　人参为五加科植物人参的干燥根及根茎。味甘、微苦，性平。归脾、肺、心经。人参是我国特产珍贵药材之一，古代医药学书籍中始见于《神农本草经》&amp;ldquo;补五脏，安精神，定魂魄，止惊悸&amp;hellip;&amp;hellip;&amp;rdquo;，列为上品。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　人参最早见于&amp;lt;春秋运斗枢&amp;gt;的记载。南北朝时，已把人参和治病联系起来，形成传说的简单情节。《梁书》（卷五十一）记载，陈留孝子阮孝绪，因母病到钟山采参，鹿引获此草，服之遂愈。《太平御览》（卷九百九十一）亦载：&amp;ldquo;隋文帝时，上党有人宅后每夜有人呼声，求之不得。去宅一里，但一人参枝首，掘之入地五尺，得人参一，如人体状，去之，后呼声遂绝。&amp;rdquo;至唐时，发展为&amp;ldquo;草妖&amp;rdquo;、&amp;ldquo;地精&amp;rdquo;的说法；有的还把人参说成能医治&amp;ldquo;鲁钝&amp;rdquo;和可以益寿的&amp;ldquo;褐衣老翁&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　&lt;strong&gt;【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n','','0','','','1','','','0','','0.00','','0','0','0','0','1');
