INSERT INTO `ysk_product_detail` VALUES('142','25','鼎鑫天阔营养片','','456','','0','/Uploads/image/product/2018-04-14/5ad18b8ab8574.png','/Uploads/image/product/2018-04-14/5ad18b8ab9a1d.png','','','','','','','1523682186','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad9894154a6d.png&quot; style=&quot;height:217px; width:300px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫天阔营养片&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：黄精、茯苓、葛根、田三七、吴茱萸、肉苁蓉、牛夕、蔬菜、沙棘籽提取物&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【相关知识】：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　田三七&amp;mdash;一具有活血化癣、消肿定痛功效，素有&amp;ldquo;金不换&amp;rdquo;、&amp;ldquo;南国神草&amp;rdquo;之美誉。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　昊茱萸&amp;mdash;&amp;mdash;味辛温，主逼中下气，止痛，咳逆寒热、除湿血痹。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　牛夕&amp;mdash;&amp;mdash;能消淤血、松弛尿道平滑肌，解除尿路梗阻。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　肉苁蓉&amp;mdash;&amp;mdash;补肾阳，益精血。用于阳癀、腰膝冷痛、筋骨酸软无力。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　蔬菜、沙棘籽提取物&amp;mdash;&amp;mdash;富台蛋白质、碳水化台物、维生素C、油脂、钙等多种元素，能滋补肾脏，扶阳固本，补肝及命门。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;　　【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','1','1','1','1');
INSERT INTO `ysk_product_detail` VALUES('143','25','鼎鑫沙棘油','','2000','','0','/Uploads/image/product/2018-04-14/5ad18bda89570.png','/Uploads/image/product/2018-04-14/5ad18bda8ab26.png','/Uploads/image/product/2018-04-14/5ad18bda8bfdf.png','','','','','','1523682266','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad98913a50bd.png&quot; style=&quot;height:196px; width:320px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘油&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;　　【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','1','0','1','1','1');
INSERT INTO `ysk_product_detail` VALUES('144','25','鼎鑫洛神营养片','','499','','0','/Uploads/image/product/2018-04-14/5ad18c3778c46.png','/Uploads/image/product/2018-04-14/5ad18c377a2d3.png','','','','','','','1523682359','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad988ce32677.png&quot; style=&quot;height:221px; width:318px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫洛神营养片&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：白芷、菊花、甘草、枸杞、桃仁、决明子、向日葵花粉、茯苓、黄精、牡蛎&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【相关知识】：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　白芷&amp;mdash;&amp;mdash;祛风解表、散寒止痛、除湿通窍、消肿排脓。可改善人体微循环，促进皮肤新陈代谢，消除色素在组织中过度堆积。《神农本草经》指出白芷：&amp;ldquo;长肌肤。润泽颜色，可作面脂。&amp;rdquo;无论是&amp;ldquo;干金面脂方&amp;rdquo;，或是慈禧太后的驻颜宫廷秘方&amp;ldquo;玉容散&amp;rdquo;，白芷都是制作面脂的主要原料。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　菊花&amp;mdash;一菊花能增强谷胱甘脑过氧化降低，具有清除自由基的能力，专家研究则发现，菊花提取物对生物膜的超氧阴离子自由基损伤具有明显保护作用，主要是通过直接进入细胞障的甘油酯后而起保护作用。这一新的发现使菊花有望开发成为新的功能性食品，尤其在抗衰老食品中发挥其作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　女人衰老的机理无外乎阴阳失衡，气血失和，气机升降出入失常，脏腑功能失调。肥胖、便秘、色斑、口臭、体臭、高血脂等疾病时有发生，如果加上心理负担，则机体衰老就会加速。女人要学会关爱自己，遁畅身体，从而通畅心理，定期的排出体内毒素，调整机体状态无疑会为今天的美丽和明日的健康打下坚实的基础。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;　　【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','0','1','1','1');
INSERT INTO `ysk_product_detail` VALUES('139','25','鼎鑫沙棘籽油螺旋藻维生素E软胶囊','','450','','0','/Uploads/image/product/2018-04-14/5ad17bcf1d3dd.png','/Uploads/image/product/2018-04-14/5ad17bcf1f153.png','','','','','','','1523678159','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad98a4e8ae3c.png&quot; style=&quot;height:319px; width:437px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘籽油螺旋藻维生素E软胶囊&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：螺旋藻粉、沙棘籽油、维生素E&lt;/p&gt;\r\n\r\n&lt;p&gt;　　&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;【相关知识】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　&lt;strong&gt;螺旋藻的营养价值&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　1.螺旋藻含丰富的蛋白质，植物性蛋白质高达60-70%。蛋白质是维持生命的基本元素。蛋白质是由20种氨基酸组成的生物大分子，其中有8种在人和动物体内不能自身合成，必须通过食物供给才能维持人和动物的正常发育和健康。而这8种氨基酸在螺旋藻中含量丰富，远远高于其他食品。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　2.螺旋藻含丰富的&amp;beta;-胡萝卜素。&amp;beta;-胡萝卜素是维生素的前体，进入人体后被酶分解为维生素A，维生素A是促进幼年动物生长的重要元素，有预防眼结膜、泪腺、鼻腔、消化道、汗腺及皮脂腺变质、干燥及角质化的功能，能促进上皮细胞的再生，加速伤口的愈合。促进骨骼和牙釉的形成，因此，长期服用螺旋藻可保护眼睛，使粗糙的皮肤变得细腻，使口腔、肠胃溃疡快速愈合。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　3.螺旋藻含丰富的维生素B1、B2、B5、B6、B11、B12、C、E， 而且各具特殊的生理功能， 缺乏其中的任何一种都可能导致疾病。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　4.螺旋藻中含很高的&amp;gamma;-亚麻酸，有促进钙吸收、提高免疫力、防止代谢紊乱和防止衰老的功能。&amp;gamma;-亚麻酸是前列腺素的前体，在加氧酶的作用下变为前列腺素，前列腺素对生殖、心血管、呼吸、消化及神经系统均有作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　5.螺旋藻中多糖，有抗辐射的功能，并通过增强机体免疫力。另外螺旋藻多糖能提高血浆中的SOD的活性，减少脂质过氧化物的生成，有抗衰老的作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　6.螺旋藻含多种人体必需的微量元素，钙、镁、钠、钾、磷、碘、铁、铜、锌等。缺铁会导致贫血，缺锌会导致发育不良，硒能激活DNA修复酶，刺激免疫球蛋白及抗体的产生，捕获自由基，降低或抵抗体内某些金属的毒性。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　7.螺旋藻中所含的叶绿素A，有其独特的造血净血功能。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;　　【注意事项】：本品不可代替药物&lt;/strong&gt;&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','1','1','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('151','25','鼎鑫沙棘果油（精油）','','399','','0','/Uploads/image/product/2018-04-14/5ad18eb7a5be0.png','/Uploads/image/product/2018-04-14/5ad18eb7a7562.png','','','','','','','1523682999','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad985e375817.png&quot; style=&quot;height:358px; width:224px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘果油（精油）&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【使用方法】：早晚空腹1到2毫升，含服。 也可外用，涂抹于作用部位，轻轻按摩至吸收。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【注意事项】：本品不可代替药物&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','1','0','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('152','25','鼎鑫 沙棘籽油(精油)','','399','','0','/Uploads/image/product/5ad9859130def.png','/Uploads/image/product/5ad985971c240.png','','','','','','','1523683071','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad9848d1822c.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘籽油（精油）&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要原料】：沙棘&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【使用方法】：早晚空腹1到2毫升，含服。 也可外用，涂抹于作用部位，轻轻按摩至吸收&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【注意事项】：本品不可代替药物&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','2','0','1','1','1');
INSERT INTO `ysk_product_detail` VALUES('153','25','沙棘能靓油','','298','','0','/Uploads/image/product/2018-04-14/5ad18f4cb28a7.png','/Uploads/image/product/2018-04-14/5ad18f4cb4083.png','','','','','','','1523683148','0','1','','','888','0','&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;沙棘能靓油主要由沙棘油、鸸鹋油、薄荷脑、芦荟以及多种蔬菜水果 的渗透因子组成。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;沙棘油通过先进的纳米雾化技术与鸸鹋、芦荟等植物精华完美结合，以鸸鹋油为渗透载体，在15-30秒钟内将沙棘、芦荟等营养精华快速导入人体组织细胞，提供细胞能量，激发细胞活力。清除自由基、抗氧化、抗过敏和提高细胞免疫力。疏通经络、运行气血、营养周身和促进细胞的修复与再生。大量的不饱和脂肪酸和亚麻酸，可以有效缓解红肿、有效减轻肌肉关节疼痛、舒缓疲劳，亦是疏经活络与消痈散瘀不可多得的养生上品！&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:16px&quot;&gt;&amp;nbsp;使用方法&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;1、热敷（用热毛巾清洁患处，或冲热水澡）&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;2、抹痛点（疼痛部位或病灶所在部位）&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;3、沿着骨缝抹&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;4、顺经络找出路（腋下、尾骨、手指头、脚底）&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;5、少量多次（每次连续抹3-5遍效果最佳）&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;6、保温保湿（包上保鲜膜并盖上毛巾或棉被）&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;7、坚持：当症状缓解后，要继续坚持抹1-3个月&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;8、禁忌：忌劳累，忌酒、生冷和辛辣，孕妇禁用，容易造成流产&lt;/span&gt;&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','0','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('154','25','鼎鑫沙棘逆颜原液','','998','','0','/Uploads/image/product/2018-04-14/5ad18f89d94e9.png','/Uploads/image/product/2018-04-14/5ad18f89daa7e.png','','','','','','','1523683209','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad984146984e.png&quot; style=&quot;height:337px; width:183px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘逆颜原液&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘逆颜原液是一款祛除抑制皱纹、紧致毛孔、祛除眼袋黑眼圈、深层美白、深层补水、淡化色斑、修复痘印和坚挺乳房的天然特种细胞修复原液，能使松弛老化的肌肤快速回转为水嫩、丝滑、紧致、亮白的肌肤，重焕青春容颜。本品采用以沙棘萃取原液为基础的多种植物精华，采用国际最新的高科技手段进行有机融合，能促进真皮层中胶原蛋白，弹力纤维增生，修复受损细胞，祛除表皮层坏死细胞，深层提高肌肤的含水量，增加皮肤厚度以及减少细纹。有效舒缓并抑制抬头纹、眼角纹、假性细纹及脸部肌肉的收缩与活动，帮助肌肉放松，使肌肤弹性组织恢复至青春常态。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　1、消除皱纹：皱纹的产生主要是由于皮肤中的胶原蛋白流失，真皮中的弹力纤维网断裂。沙棘逆颜原液，可直接渗透到皮肤真皮层，促进真皮层中胶原蛋白、弹力纤维增生，修复断裂受损的纤维组织，达到祛除及抑制皱纹的效果。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　2、补水、美白：皮肤暗淡、无光是由于皮肤新陈代谢缓慢，老化角质无力自然脱落，使皮肤变得晦暗粗糙。沙棘逆颜原液，能有效帮助皮肤细胞的新陈代谢，加速细胞生长，提高肌肤含水量，有效防止皮肤水分蒸发，增强皮肤的锁水能力，让肌肤更白皙水嫩，细腻柔滑，倒逆生长。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　3、淡化色斑、修复痘印：沙棘逆颜原液中的有效成分，可以预防酪胺酸酶的活性，抑制黑色素的生成，帮助色素排出，能使面部黑斑迅速淡化及有效抑制黑斑产生，并且可以修复受损组织，解除痘印烦恼。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　4、驱除黑眼圈、眼袋：沙棘逆颜原液，可促进血液循环畅通，淡化因疲劳而形成的黑眼圈、眼袋。同时增加眼部周边肌肤的紧密度，使眼睛看上去更加光彩、迷人&lt;/p&gt;\r\n\r\n&lt;p&gt;　　5、挺拔乳房：乳房主要是由结缔组织构成，而胶原蛋白是结缔组织的主要成分，补充沙棘逆颜原液，激发结缔组织胶原蛋白与弹力蛋白的再生，长期使用能使松弛的乳房组织紧实、提升起下垂的乳房，使乳房挺拔、丰满、富有弹性。&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','1','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('155','25','鼎鑫沙棘逆颜水凝蚕丝面膜','','399','','0','/Uploads/image/product/2018-04-14/5ad18fd59c196.png','/Uploads/image/product/2018-04-14/5ad18fd59e0b2.png','','','','','','','1523683285','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad983d042f77.png&quot; style=&quot;height:414px; width:313px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫沙棘逆颜水凝蚕丝面膜&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　本品使用100%真蚕丝做贴膜，并且同时蕴含当今全球最具影响力的四大肌肤改善成分：&lt;/p&gt;\r\n\r\n&lt;p&gt;　　1、沙棘萃取精华&amp;ldquo;OPCs（逆生长基础因子）：肌肤逆生长的基质&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　2、&amp;ldquo;NMF&amp;amp;HA（天然保湿因子）：肌肤逆生长的天然水源&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　3、&amp;ldquo;SACA（强力抗氧化细胞活化促进因子）： 肌肤逆生长的工程师&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　4、&amp;ldquo;EGF（美丽因子）：肌肤逆生长的&amp;ldquo;真命&amp;rdquo;美容天使&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【主要功效】：清透亮颜，滋养肌肤，改善肌肤光泽，娇细柔嫩，保持肌肤活力，使肌肤光滑细腻。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【使用方法】：洁肤后，先将法国海洋之谜羽丝缕面膜兰色无纺布揭掉，将中间层的面膜直接敷在面部并轻按压，再将有孔珍珠膜揭掉，20分钟左右取下即可，并把残留精华液轻按摩至吸收；每天使用效果更佳。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　【注意事项】：每个人的肤质各不相同，建议使用前先进行局部的皮肤测试。&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','0','1','1','1');
INSERT INTO `ysk_product_detail` VALUES('156','25','鼎鑫天然沙棘手工精油皂','','298','','0','/Uploads/image/product/2018-04-14/5ad19032a12f3.png','/Uploads/image/product/2018-04-14/5ad19032a2a75.png','','','','','','','1523683378','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad983a05cf85.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫天然沙棘手工精油皂&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　本品由沙棘油、沙棘OPC、椰子油、甜杏仁油、甘油等多种食用级的特种营养植物油原料，及天然沙棘精油、玫瑰精油、柠檬精油等制成的含有天然植物芳香烃的天然植物精油皂。天然沙棘手工精油皂不添加任何防腐剂，表面活性剂等化学成分，是一种非常安全而有效的皮肤清洁及美容产品，低温制作，甘油不会流失，除了细腻的清洁效果，还能呵护滋润皮肤，不会对皮肤造成负担，还能具有精油的养护效果，比市面上常用的洗面奶效果好，而且安全。天然沙棘手工精油皂能提供非常高的保湿效能，同时也能够更深层清洁肌肤，给予肌肤最健康自然的呵护。并富有轻柔、清新的植物香氛，使人如沐大自然的海洋。天然沙棘手工精油皂适用所有肤质，尤其是干燥或任何敏感红肿和发炎皮肤。主要成分沙棘OPC具有强壮和收缩微血管的效果， 对老化皮肤有极佳的回春作用。抚平情绪，沮丧、哀伤、妒忌和憎恶的时候，提振心情，舒缓神经紧张和压力，能使女人对自我产生积极、正面的感受。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　天然沙棘手工精油皂含丰富的维生素C，特别有益于美白、收敛、平衡油脂、治疗青春痘等油性皮肤症状。其味道清新甜美，对于季节转化，肌肤极容易出现的问题，洗洗都能轻松解决，让您恢复亮白娇嫩肌肤，充满自信。&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','1','0','0','1','1');
