INSERT INTO `ysk_product_detail` VALUES('159','25','鼎鑫头部舒养套','','4000','','0','/Uploads/image/product/2018-04-14/5ad190f2ab5eb.png','/Uploads/image/product/2018-04-14/5ad190f2ad58e.png','','','','','','','1523683570','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad982ad19912.png&quot; style=&quot;height:304px; width:522px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫头部舒养套&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　有益于大脑皮层的功能调节、可以益智健脑、增强记忆、缓解疲劳、改善睡眠、防止脱发、消除紧张、焦虑、延缓衰老、使大脑重新获得充沛的精力。预防并有效调理神经性头痛、后头痛、颈痛症、眶上神经痛、三叉神经痛、高血压等。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第一步：沙棘背部活焕霜：取本品适量，根据使用方法说明书在保养部位进行按摩操作。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第二步：沙棘肽背部精粹油：取本品1支，涂抹在保养部位进行按摩推拿，直至吸收。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第三步：沙棘肽背部焕养液：取本品1支，涂抹至保养部位，用手指轻拍，直至完全吸收。&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','0','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('160','25','鼎鑫主脊养护套','','4000','','0','/Uploads/image/product/2018-04-14/5ad1914bb2021.png','/Uploads/image/product/2018-04-14/5ad1914bb3c35.png','','','','','','','1523683659','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad98136d2e8d.png&quot; style=&quot;height:299px; width:444px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;鼎鑫主脊养护套&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　疏通颈腰部经络，行气活血，通络止痛，改善颈腰部酸胀、肩膀酸痛、颈腰椎僵硬不适的症状，减轻颈腰椎疼痛，缓解肌肉紧张，加快颈腰部血液循环及代谢。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第一步：沙棘背部活焕霜：取本品适量，根据使用方法说明书在保养部位进行按摩操作。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第二步：沙棘肽背部精粹油：取本品1支，涂抹在保养部位进行按摩推拿，直至吸收。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第三步：沙棘肽背部焕养液：取本品1支，涂抹至保养部位，用手指轻拍，直至完全吸收&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','2','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('161','25','鼎鑫十二正经舒养套','','4000','','0','/Uploads/image/product/2018-04-14/5ad1918cf18ae.png','/Uploads/image/product/2018-04-14/5ad1918cf3506.png','','','','','','','1523683725','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad981a9dce06.png&quot; style=&quot;height:264px; width:456px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫十二正经舒养套&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　活血化瘀，疏通经络，祛风除湿，散寒止痛，改善肌肉，关节，韧带，因经络不通所导致的疼痛，胂胀，物理变异等症状。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第一步：沙棘肽经络活焕霜：取本品适量，根据使用方法说明书在保养部位进行按摩操作。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第二步：沙棘肽经络精粹油：取本品1支，涂抹在保养部位进行按摩推拿，直至吸收。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第三步：沙棘肽经络焕养液：取本品1支，涂抹至保养部位，用手指轻拍，直至完全吸收&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','0','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('162','25','鼎鑫淋系净通套','','4000','','0','/Uploads/image/product/2018-04-14/5ad191dc77eda.png','/Uploads/image/product/2018-04-14/5ad191dc79cee.png','','','','','','','1523683804','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad9820619409.png&quot; style=&quot;height:278px; width:462px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;鼎鑫淋系净通套&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　改善淋巴循环系统，促进淋巴液的流动，加速淋巴系统排毒，提高身体免疫功能。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第一步：沙棘肽淋系活焕霜：取本品适量，根据使用方法说明书在保养部位进行按摩操作。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第二步：沙棘肽淋系精粹油：取本品1支，涂抹在保养部位进行按摩推拿，直至吸收。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　第三步：沙棘肽淋系焕养液：取本品1支，涂抹至保养部位，用手指轻拍，直至完全吸&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','0','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('163','25','鼎鑫沙棘凝胶','','298','','0','/Uploads/image/product/2018-04-14/5ad19214ae915.png','/Uploads/image/product/2018-04-14/5ad19214afede.png','','','','','','','1523683860','0','1','','','888','0','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad97ed2f3def.png&quot; style=&quot;height:563px; width:589px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;font color=&quot;#ff0000&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/font&gt;鼎鑫沙棘凝胶&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;　　【产品介绍】：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　采用了优质原料&amp;mdash;&amp;mdash;由先进的&amp;ldquo;冷冻稳定法&amp;rdquo;从天然野生沙棘果中提炼而成，其纯净度高，能舒缓皮肤不适，保持皮肤健康，防止皮肤粗糙，增强皮肤弹性，对皮肤没有刺激性。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘凝胶中的有效成分能扩张毛细血管，促进微循环，强化细胞活力。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘凝胶内含的OPC，维生素C，维生素E，胡萝卜素等自由基的清除剂，能有效延缓皮肤细胞变老。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　沙棘凝胶内的氨基酸、维生素、矿物质、酵素、有机酸及水是皮肤必须的营养素，具有天生的收敛作用，能使皮肤坚实细致，预防皮肤松弛，有效锁住水分，抑制产生黑色素。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　缓解皮肤干性，使皱纹明显减少，皮肤变白皙。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　由杀菌功能，若有外阴瘙痒的症状，也可以用沙棘凝胶外涂。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　祛斑淡斑，在有斑的部位多做按摩，促进皮肤吸收，增强微循环，1日3次。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　保湿美白：刺激血液循环，帮助肌肤捕捉氧气，激活细胞活性，锁住水分，抑制斑点产生，美白皮肤。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　控油祛痘：平衡肌肤成分，达到水油平衡，含有的杀菌成分能抑制微生物生长，减少痘痘的再生。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　晒后修护：镇静肌肤，消除晒后不适，其修护成分能帮助皮肤提高抵御外界侵害。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　对各种皮肤病具有很好的改善及康复作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　适用人群广泛，大人小孩都可使用。&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','1','0','0','1','1');
INSERT INTO `ysk_product_detail` VALUES('164','25','国士健能量仪','','5000','','0','/Uploads/image/product/2018-04-14/5ad19289253a3.png','/Uploads/image/product/2018-04-14/5ad1928926b51.png','','','','','','','1523684226','0','1','','','884','0','&lt;p&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-size:18px&quot;&gt;国士健&amp;middot;能量仪 能利用物理能量来调理人类亚健康，具有八种能量的综合效应。将静磁、动磁、纳米远红外、音乐脉冲、特效养生音乐、针灸按摩、低频生物电、中频生物电于一体，产生的高能立体生物场，经过科学的叠加技术产生出8大物理能量，弥补了单纯的几种能量不足的缺陷，效果更强、更快、更持久、调理范围更广泛。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-size:18px&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad9604492e7d.jpg&quot; style=&quot;height:459px; width:466px&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;color:rgb(255, 0, 0)&quot;&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;4大世界首创国家专利&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;1.世界首创的集八大物理能量于一身，可同时调理多种疾病，穿透力达9&amp;mdash;12CM。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;2.世界首创的动静结合的复合不均匀磁场，更有效的调整人体各种生理机能。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;3.世界首创的近似磁单极技术，磁疗效果更佳。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;4.世界首创的音乐调理与多种物理疗法有机结合，提高调理效果。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad9609bd2876.png&quot; style=&quot;height:584px; width:587px&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;8大能量场&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-04-20/5ad960bd77865.png&quot; style=&quot;height:596px; width:590px&quot; /&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;1.不均匀永（静）磁场：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;①辅助镇静；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;②辅助止痛；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;③辅助消炎；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;④辅助消肿；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;⑤辅助止泻；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;⑥降血脂、调节血压.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;2.不均匀单向脉冲磁场：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;改善血液循环，调节血管的收缩功能；②提高肌肉韧带的张力，促进神经和肌肉的恢复等治疗作用；③应用近似磁单极技术的脉冲磁场比永磁场作用更强；④1hz、30hz、100hz。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;3.远红外线：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;①刺激了大分子的活性；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;②促进和改善血液循环；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;③增强新陈代谢；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;④提高免疫系统；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;⑤辅助消炎消肿；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;⑥辅助镇静镇痛；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;⑦激活大分子团的水，使其变成小分子团的水或单分子水。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;4.特效养生音乐：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;①对细胞产生细微的按摩；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;②调整新陈代谢，增强抗病能力；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;③协调各神经中枢的功能活动；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;④使大脑的功能处于最佳状态；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;⑤改善组织细胞的各种功能活动和代谢活动；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;⑥明显降低疼痛。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;5.音乐脉冲电流：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;①辅助镇静、辅助镇痛；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;②兴奋神经肌肉组织；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;③改善局部的血液循环；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;④辅助消炎、辅助消肿；催眠；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;⑤比单一频率的脉冲电流调节作用更好。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;6.针灸按摩：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;①疏通经络，&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;活血化瘀，达到辅助作用；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;②恢复人体组织器官的功能；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;③促进组织液的交换；④增强体质，预防疾病。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;7.低频生物电：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;清理、中和体内的酸性垃圾，代谢成盐和水排出体外。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:rgb(253, 41, 57); font-size:18px&quot;&gt;8.中频生物电：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;激活细胞，通经活络，排风排寒排湿。&lt;/span&gt;&lt;/p&gt;\r\n','','0','','','1','','','1745','','0.00','','0','0','0','1','1');
